import React from 'react';
import './TransmissionsPage.css';

const TransmissionsPage = () => {
  return (
    <div className="transmissions-page">
      <div className="transmissions-header">
        <div className="macos-window-controls">
          <div className="control red"></div>
          <div className="control yellow"></div>
          <div className="control green"></div>
        </div>
        <div className="macos-title">Transmissions - egirls.faith</div>
      </div>

      <div className="transmissions-content">
        <div className="transmissions-text">
          <h1>Transmissions</h1>
          <p>
            Welcome to the transmissions page. This is where we'll share our latest 
            digital art, experiments, and creative explorations.
          </p>
          <p>
            Stay tuned for updates and new content coming soon.
          </p>
        </div>
      </div>
    </div>
  );
};

export default TransmissionsPage;
